import axios from "axios";
import React from "react";

const baseURL = "https://pokeapi.co/api/v2/pokemon/?offset=0&limit=1300";

function List() {
    onst [post, setPost] = React.useState(null);

  React.useEffect(() => {
    axios.get(baseURL).then((response) => {
      setPost(response.data.results);
    });
  }, []);

  if (!post) return null;

  return (
    <div>
      {post.map((item) => (
      <h1> {item.name} </h1>
      ))}

    </div>
  );
}

export default List
